:04',3000,5000,0,200,100),(11000,'A MST Problem','<p>It is just a mining spanning tree ( 最小生成树 ) problem, what makes you a little difficult is that you are in a 3D space.</p>','<div>The first line of the input contains the number of test cases in the file. And t he first line of each case</div>\n<div>contains one integer numbers n(0&lt;n&lt;30) specifying the number of the point . The n next n line s, each line</div>\n<div>contain s Three Integer Numbers xi,yi and zi, indicating the position of point i.</div>','<p>For each test case, output a line with the answer, which should accurately rounded to two decimals .</p>\n<p></p>','2\n2\n1 1 0\n2 2 0\n3\n1 2 3\n0 0 0\n1 1 1','1.41\n3.97','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11001,'Border ','<div>You are to write a program that draws a border around a closed path into a bitmap, as displayed in the</div>\n<div>following figure:</div>\n<div><img width=\"303\" height=\"306\" alt=\"\" src=\"/admin/../upload/pimg1001_1.png\" /></div>\n<div>The path is closed and runs along the grid lines, i.e. between the squares of the grid. The path runs</div>\n<div>counter-clockwise, so if following the path is considered as going &rdquo; forward &rdquo; , the border pixels are always</div>\n<div>to the &rdquo; right &rdquo; of the path. The bitmap always covers 32 by 32 squares and has its lower left corner at (0,0).</div>\n<div>You can safely assume that the path never touches the bounding rectangle of the bitmap and never</div>\n<div>touches or crosses itself. Note that a bit gets set if it is on the outside of the area surrounded by the path</div>\n<div>and if at least one of its edges belongs to the path, but not if only one of its corners is in the path. (A look</div>\n<div>at the convex corners in the figure should clarify that statement.)</div>\n<p></p>','<div>The first line of the input contains the number of test cases in the file. Each test case that follows</div>\n<div>consists of two lines. The first line of each case contains two integer numbers x and y specifying the</div>\n<div>starting point of the path. The second line contains a string of variable length. Every letter in the string</div>\n<div>symbolizes a move of length one along the grid. Only the letters `W\' (``west\'\'), `E\' (``east\'\'), `N\' (``north\'\'),</div>\n<div>`S\' (``south\'\'), and `.\' (``end of path\'\', no move) appear in the string. The end-of-path character (`.\') is&nbsp;immediately followed by the end of the line.</div>\n<div></div>\n<p></p>','<div>For each test case, output a line with the number of the case (`Bitmap #1\', `Bitmap #2\', etc.). For each</div>\n<div>row of the bitmap from top to bottom, print a line where you print a character for every bit in that row</div>\n<div>from left to right. Print an uppercase `X\' for set bits and a period `.\' for unset bits. Output a blank line</div>\n<div>after each bitmap.</div>\n<p></p>','1\n2 1\nEENNWNENWWWSSSES.','Bitmap #1\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n................................\n.XXX............................\nX...X...........................\nX..X............................\nX...X...........................\n.X..X...........................\n..XX............................\n','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11002,'C hicken and rabbit s','<div>Chicken and rabbits are in a same cage. As we all know, chicken has two legs but rabbit has four. Now</div>\n<div>we know the number of legs in the cage is A, please tell me how many animals may in the cage at least</div>\n<div>and at most.</div>\n<p></p>','<div>The first line of the input contains the number of test cases in the file. Each test case that follows</div>\n<div>consists of one lines. each case contains only one integer numbers A specifying the total legs in the</div>\n<div>cage .</div>\n<p></p>','<p>For each test case, print a line contains the answer</p>\n<p></p>','2\n3\n20','0 0\n5 10','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11003,'Diamond ','<div>Diamond mine is a mini-game which is played on an 8 * 8 board as you can see below.</div>\n<div><img width=\"219\" height=\"213\" alt=\"\" src=\"/admin/../upload/pimg1003_1.png\" /></div>\n<div><img width=\"0\" height=\"0\" alt=\"\" src=\"/admin/../upload/pimg1003_2.png\" /></div>\n<div>The board is filled with different colors of diamonds. The player can make one move at a time. A move is</div>\n<div>legal if it swaps two adjacent diamonds(not diagonally) and after that, there are three or more adjacent</div>\n<div>diamonds in a row or column with the same color. Those diamonds will be taken away and new</div>\n<div>diamonds will be put in their positions. The game continues until no legal moves exist.</div>\n<div>Given the board description. You are going to determine whether a move is legal.</div>\n<p></p>','<div>The input contains several cases. Each case has exactly 9 lines. The first 8 lines each contains a string</div>\n<div>of 8 characters. The characters are \'R\'(Red), \'O\'(Orange), \'G\'(Green), \'P\'(Purple), \'W\'(White), \'Y\'(Yellow)</div>\n<div>or \'B\'(Blue). All characters are uppercase. No 3 diamonds of the same color are initially in adjacent</div>\n<div>positions in a row or column. The last line has 4 integers in the form &quot; row1 column1 row2 column2&quot;</div>\n<div>describing the postions of the 2 diamonds that the player wants to swap. Rows are marked 1 to 8</div>\n<div>increasingly from top to bottom while columns from left to right. Input is terminated by EOF.</div>\n<p></p>','<p>For each case, output &quot;Ok!&quot; if the move is legal or &quot;Illegal move!&quot; if it is not.</p>\n<p></p>','PBPOWBGW\nRRPRYWWP\nYGBYYGPP\nOWYGGRWB\nGBBGBGGR\nGBWPPORG\nPPGORWOG\nWYWGYWBY\n4 3 3 3\nPBPOWBGW\nRRPRYWWP\nYGBYYGPP\nOWYGGRWB\nGBBGBGGR\nGBWPPORG\nPPGORWOG\nWYWGYWBY\n5 5 6 5','Ok!\nIllegal move!','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11004,'Easy List Operations','<div>A list is a sequence of or more elements, expressed in this form: [a 1 , a 2 , a 3 , ... , a n ], where each a i</div>\n<div>is or more consecutive digits or lowercase letters. i.e. each list begins with a left square bracket,</div>\n<div>then zero or more elements separated by a single comma, followed by a right square bracket. There will</div>\n<div>be no whitespace characters (spaces, TABs etc) within a list.</div>\n<div>In this problem, we use two list operations: append (++) and remove (--).</div>\n<div>1. A ++ B: append elements in B to the end of A.</div>\n<div>2. A -- B: remove all the elements in B, from A. If something appears more than once in B, remove it that</div>\n<div>many times in A. If there are many equal elements in A to choose from, remove them from left to right</div>\n<div>(until all occurrences are removed, or there is no need to remove more elements).</div>\n<div>Your task is to write a calculator, evaluating simple expressions or the form &quot;list1 ++ list2&quot; or &quot;list1 --</div>\n<div>list2&quot;.</div>\n<p></p>','<div>There will be at most 10 expressions, one in each line, each having the form &quot;list1 ++ list2&quot; or &quot;list1 --</div>\n<div>list2&quot;, with no more than 80 characters in total (not counting the newline character). There will be exactly</div>\n<div>two spaces in each line: one before and one after the operator. Input ends with a single <strong>dot</strong>. The input is</div>\n<div>guaranteed to satisfy the restrictions stated above.</div>\n<p></p>','<p>For each expression, print its result on a single line.</p>\n<p></p>','[1,2,3] ++ [1,2,3]\n[a,b,c,t,d,e,t,x,y,t] -- [t]\n[a,b,c,t,d,e,t,x,y,t] -- [t,t,t,t]\n[123] ++ [456]\n.','[1,2,3,1,2,3]\n[a,b,c,d,e,t,x,y,t]\n[a,b,c,d,e,x,y]\n[123,456]','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11005,'Fortun e Test','<div>A lot of people have played fortune Test(or called RP Test) before. Let &rsquo; s create a new Test below.</div>\n<div>Suppose the worth of a=1, b=4,c=9 &hellip; and z=26^2. Then abc can describe as 149,and abd describe as</div>\n<div>1416. As it is too large ,we take it mod 101 as ours fortune worth. S o abd has only 2 RP. Now I give you</div>\n<div>a name, please tell me the worth of it.</div>\n<p></p>','<div>The first line of the input contains the number of test cases in the file. Each test case that follows</div>\n<div>consists of one lines. each case contains only one string s specifying a person &rsquo; s name, which only</div>\n<div>contains lower-case .</div>\n<p></p>','<p>For each test case, print a line contains the answer.</p>\n<p></p>','1\na','1','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11006,'Give me the answer','<div>Farmer John commanded his cows to search for different sets of numbers that sum to a given number.</div>\n<div>The cows use only numbers that are an integer power of 2. Here are the possible sets of numbers that</div>\n<div>sum to 7:</div>\n<div>1) 1+1+1+1+1+1+1</div>\n<div>2) 1+1+1+1+1+2</div>\n<div>3) 1+1+1+2+2</div>\n<div>4) 1+1+1+4</div>\n<div>5) 1+2+2+2</div>\n<div>6) 1+2+4</div>\n<div>Help FJ count all possible representations for a given integer N (1 &lt;= N &lt;= 1 ,000,000)</div>\n<p></p>','<div>The first line of the input contains the number of test cases in the file. And t he first line of each case</div>\n<div>contains one integer numbers n</div>\n<p></p>','<p>For each test case, output a line with the ans % 1000000000.</p>\n<p></p>','1\n7','6','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11007,'Hidden Number','<p>Your job is to find out the secret number hidden in a matrix, each of whose element is a digit (\'0\'-\'9\') or a letter (\'A\'-\'Z\'). You can see an example matrix in Figure 1.&nbsp;</p>\n<p>&nbsp;<img width=\"497\" height=\"337\" alt=\"\" src=\"/admin/../upload/pimg1007_1.png\" /></p>\n<p></p>\n<div><span style=\"font-size:12.0pt;\">The hidden number and other non-secret ones are coded in a matrix as sequences of digits in a decimal format. You should only consider sequences of digits D1 D2 ... Dn such that Dk+1 (1 &lt;= k &lt; n) is either right next to or immediately below Dk in the matrix. The secret you are seeking is the largest number coded in this manner. </span></div>\n<div><span style=\"font-size:12.0pt;\">Four coded numbers in the matrix in Figure 1, i.e., 908820, 23140037, 23900037, and 9930, are depicted in Figure 2. As you may see, in general, two or more coded numbers may share a common subsequence. In this case, the secret number is 23900037, which is the largest among the set of all coded numbers in the matrix.&nbsp;</span></div>\n<div></div>\n<div><img width=\"542\" height=\"419\" alt=\"\" src=\"/admin/../upload/pimg1007_2.png\" /></div>\n<div>In contrast, the sequences illustrated in Figure 3 should be excluded: 908A2 includes a letter; the fifth digit of 23149930 is above the fourth; the third digit of 90037 is below right of the second.</div>\n<div></div>\n<div><img width=\"563\" height=\"346\" alt=\"\" src=\"/admin/../upload/pimg1007_3.png\" /></div>\n<div>Write a program to figure out the secret number from a given matrix.</div>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\n<div></div>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\n<div></div>\n<p></p>','<div>The input consists of multiple data sets, each data set representing a matrix. The format of each data</div>\n<div>set is as follows.</div>\n<div>W H</div>\n<div>C11C12 ... C1W</div>\n<div>C21C22 ... C2W</div>\n<div>...</div>\n<div>CH1CH2 ... CHW</div>\n<div>In the first line of a data set, two positive integers W and H are given. W indicates the width (the number</div>\n<div>of columns) of the matrix, and H indicates the height (the number of rows) of the matrix. W+H is less</div>\n<div>than or equal to 70.</div>\n<div>H lines follow the first line, each of which corresponds to a row of the matrix in top to bottom order. The</div>\n<div>i-th row consists of W characters Ci1Ci2 ... CiW in left to right order. You may assume that the matrix</div>\n<div>includes at least one non-zero digit.</div>\n<div>Following the last data set, two zeros in a line indicate the end of the input.</div>\n<p></p>','<p>For each data set, print the hidden number on a line. Leading zeros should be suppressed.</p>\n<p></p>','7 4\n9R2A993\n0E314A0\n8A900DE\n820R037\n6 7\nJH03HE\nID7722\n0DA1AH\n30C9G5\n99971A\nCA7EAI\nAHLBEM\n20 2\nA1234567891234CBDEGH\nBDEDF908034265091499\n0 0\n','23900037\n771971\n12345908034265091499','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11008,'I think it\'s hard','<div>Xiao Ming is only seven years old, Now I give him some numbers, and ask him what is the second</div>\n<div>largest sum if he can choose a part of them. For example, if I give him 1 、 2 、 3 ， then he should tell</div>\n<div>me 5 as 6 is the largest and 5 is the second. I think it is too hard for him, isn &rsquo; t it?</div>\n<p></p>','<div>Standard input will contain multiple test cases. The first line of the input is a single integer T (1 &lt;= T &lt;=</div>\n<div>10) which is the number of test cases. And it will be followed by T consecutive test cases.</div>\n<div>Each test case starts with a line containing an integer N (1&lt;N&lt;10) , the number I give Xiao Ming . The</div>\n<div>second line contains N Integer numbers ai (-10&lt;ai&lt;10),</div>\n<p></p>','<p>For each test case, output the answer.</p>\n<p></p>','2\n3\n1 2 3\n4\n0 1 2 3','5\n5','','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11009,'Just Pour the Water','<div>Shirly is a very clever girl. Now she has two containers (A and B), each with some water. Every minute,</div>\n<div>she pours half of the water in A into B, and simultaneous pours half of the water in B into A. As the</div>\n<div>pouring continues, she finds it is very easy to calculate the amount of water in A and B at any time. It is</div>\n<div>really an easy job :).</div>\n<div>But now Shirly wants to know how to calculate the amount of water in each container if there are more</div>\n<div>than two containers. Then the problem becomes challenging.</div>\n<div>Now Shirly has N (2 &lt;= N &lt;= 20) containers (numbered from 1 to N ). Every minute, each container is</div>\n<div>supposed to pour water into another K containers ( K may vary for different containers). Then the water</div>\n<div>will be evenly divided into K portions and accordingly poured into anther K containers. Now the question</div>\n<div>is: how much water exists in each container at some specified time?</div>\n<div>For example, container 1 is specified to pour its water into container 1, 2, 3. Then in every minute,</div>\n<div>container 1 will pour its 1/3 of its water into container 1, 2, 3 separately (actually, 1/3 is poured back to</div>\n<div>itself, this is allowed by the rule of the game).</div>\n<p></p>','<div>Standard input will contain multiple test cases. The first line of the input is a single integer T (1 &lt;= T &lt;=</div>\n<div>10) which is the number of test cases. And it will be followed by T consecutive test cases.</div>\n<div>Each test case starts with a line containing an integer N , the number of containers. The second line</div>\n<div>contains N floating numbers, denoting the initial water in each container. The following N lines describe</div>\n<div>the relations that one container(from 1 to N ) will pour water into the others. Each line starts with an</div>\n<div>integer K (0 &lt;= K &lt;= N ) followed by K integers. Each integer ([1, N ]) represents a container that should</div>\n<div>pour water into by the current container. The last line is an integer M (1&lt;= M &lt;= 1,000,000,000) denoting</div>\n<div>the pouring will continue for M minutes.</div>\n<p></p>','<div>For each test case, output contains N floating numbers to two decimal places, the amount of water</div>\n<div>remaining in each container after the pouring in one line separated by one space. There is no space at</div>\n<div>the end of the line.</div>\n<p></p>','1\n2\n100.00 100.00\n1 2\n2 1 2\n2','75.00 125.00','<div>the capacity of the container is not limited and all the pouring at every minute is processed at the</div>\n<div>same time.</div>\n<p></p>','20100831湖工大校赛','2013-12-06 20:05:07',1,32,0,0,0),(11010,'A + B Problem','<p><span style=\"font-size: 14px; \">Calculate&nbsp;</span><i style=\"font-size: 14px; \">A + B</i><span style=\"font-size: 14px; \">.</span></p>\r\n<p></p>','<p><span style=\"font-size: 14px; \">Each line will contain two integers&nbsp;</span><i style=\"font-size: 14px; \">A</i><span style=\"font-size: 14px; \">&nbsp;and&nbsp;</span><i style=\"font-size: 14px; \">B</i><span style=\"font-size: 14px; \">. Process to end of file.</span></p>\r\n<p></p>','<p><span style=\"font-size: 14px; \">For each case, output&nbsp;</span><i style=\"font-size: 14px; \">A + B</i><span style=\"font-size: 14px; \">&nbsp;in one line.</span></p>\r\n<p></p>','1 2','3','<p>Still A + B</p>\r\n<p></p>','SCOJ','2013-12-06 20:05:07',1,32,0,1,2),(11011,'回文','<p><a id=\"fck_paste_padding\">﻿</a><span style=\"font-family: 宋体; font-size: 12pt;\">回文是指一个字符串从前面读和从后面读都一样，例如，&ldquo;</span><font face=\"Times New Roman\" style=\"font-size: 12pt;\">pop</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">&rdquo;和&ldquo;</font><font face=\"Times New Roman\" style=\"font-size: 12pt;\">abba</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">&rdquo;是回文，&ldquo;</font><font face=\"Times New Roman\" style=\"font-size: 12pt;\">abab</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">&rdquo;不是回文。编写程序来判断一个字符串是否回文。字符串从键盘输入，以回车结束。如果是回文，输出</font><font face=\"Times New Roman\" style=\"font-size: 12pt;\">true</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">；否则，输出</font><font face=\"Times New Roman\" style=\"font-size: 12pt;\">false</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">。</font></p>\r\n<p></p>','<p><span style=\"font-family: 宋体; font-size: 16px; text-indent: 32px;\">第</span><font face=\"Times New Roman\" style=\"font-size: 16px; text-indent: 32px;\">1</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 16px; text-indent: 32px;\">行输入字符串的个数</font><font face=\"Times New Roman\" style=\"font-size: 16px; text-indent: 32px;\">n,</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 16px; text-indent: 32px;\">第</font><font face=\"Times New Roman\" style=\"font-size: 16px; text-indent: 32px;\">2</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 16px; text-indent: 32px;\">行到</font><font face=\"Times New Roman\" style=\"font-size: 16px; text-indent: 32px;\">n+1</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 16px; text-indent: 32px;\">行，每一行对应一个字符串。每个字符串的长度不会超过</font><font face=\"Times New Roman\" style=\"font-size: 16px; text-indent: 32px;\">1000</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 16px; text-indent: 32px;\">。</font></p>','<p><a id=\"fck_paste_padding\">﻿</a><span style=\"font-family: 宋体; font-size: 12pt;\">输出</span><font face=\"Times New Roman\" style=\"font-size: 12pt;\">n</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">行，其中第</font><font face=\"Times New Roman\" style=\"font-size: 12pt;\">i</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">行表示前面输入的第</font><font face=\"Times New Roman\" style=\"font-size: 12pt;\">i</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">个字符串是否是回文的判断，若是&ldquo;是&rdquo;则输出&ldquo;</font><font face=\"Times New Roman\" style=\"font-size: 12pt;\">true</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">&rdquo;，否则输出&ldquo;</font><font face=\"Times New Roman\" style=\"font-size: 12pt;\">false</font><font face=\"宋体\" style=\"font-family: 宋体; font-size: 12pt;\">&rdquo;。</font></p>\r\n<p></p>','3\r\npop\r\nabba\r\nxyyxz','true\r\ntrue\r\nfalse','','SCUT','2013-12-06 20:05:07',1,32,0,0,0),(11012,'求和','<p class=\"p0\" style=\"margin-bottom:0pt; margin-top:0pt; \"><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'宋体\'; \">给出<font face=\"Times New Roman\">m</font><font face=\"宋体\">个已经从小到大排好序的整数，另外给一个整数</font><font face=\"Times New Roman\">s</font><font face=\"宋体\">，希望知道</font><font face=\"Times New Roman\">m</font><font face=\"宋体\">个数中是否有两个位置不同的数的和等于</font><font face=\"Times New Roman\">s</font><font face=\"宋体\">。</font></span></p>\r\n<p></p>','<p class=\"p0\" style=\"text-indent:18.0000pt; margin-bottom:0pt; margin-top:0pt; \"><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'宋体\'; \">首先输入整数<font face=\"Times New Roman\">N</font><font face=\"宋体\">，表示</font><font face=\"Times New Roman\">N</font><font face=\"宋体\">种测试情况。接下来是每种测试情况的输入数据。</font></span></p>\r\n<p class=\"p0\" style=\"text-indent:18.0000pt; margin-bottom:0pt; margin-top:0pt; \"></p>\r\n<p class=\"p0\" style=\"text-indent:18.0000pt; margin-bottom:0pt; margin-top:0pt; \"><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'宋体\'; \">每种测试情况的第一行包括两个整数<font face=\"Times New Roman\">m</font></span><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'Times New Roman\'; \">(&lt;=1000001)&nbsp;</span><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'宋体\'; \">和</span><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'Times New Roman\'; \">&nbsp;</span><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'宋体\'; \">s<font face=\"宋体\">，第二行输入</font><font face=\"Times New Roman\">m</font><font face=\"宋体\">个数据。</font></span><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'宋体\'; \"><o:p></o:p></span></p>\r\n<p></p>\r\n<p class=\"p0\" style=\"text-indent:18.0000pt; margin-bottom:0pt; margin-top:0pt; \"><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'宋体\'; \"><o:p></o:p></span></p>\r\n<p></p>','<p class=\"p0\" style=\"margin-bottom:0pt; margin-top:0pt; \"><span style=\"mso-spacerun:\'yes\'; font-size:12.0000pt; font-family:\'宋体\'; \">每种测试情况对应一行输出，如果存在<font face=\"Times New Roman\">m</font><font face=\"宋体\">个数中的两个数之和等于</font><font face=\"Times New Roman\">s</font><font face=\"宋体\">，输出&ldquo;</font><font face=\"Times New Roman\">yes</font><font face=\"宋体\">&rdquo;，否则输出&ldquo;</font><font face=\"Times New Roman\">no</font><font face=\"宋体\">&rdquo;。</font></span></p>\r\n<p></p>','2\r\n4 3\r\n1 2 3 4\r\n2 3\r\n1 3','yes\r\nno','','SCUT','2013-12-06 20:05:07',1,32,0,0,0),(11013,'四则运算','<p><a id=\"fck_paste_padding\">﻿</a>请实现简单四则运算表达式求值程序。表达式中的运算符包含&ldquo;+&rdquo;、&nbsp;&ldquo;-&rdquo;、&nbsp;&ldquo;*&rdquo;、&nbsp;&ldquo;/&rdquo;、&nbsp;&ldquo;(&rdquo;和&ldquo;)&rdquo;，分别表示加、减、乘、整除、左括号、右括号，表达式的操作数都是正整数类型。程序的输入是表达式字符串，输出是运算的结果。假设不存在除数为0的情况。</p>\r\n<p></p>','<p class=\"p0\" style=\"margin-bottom:0pt; margin-top:0pt; \">第一行输入字符串的个数n，从第2行到第n+1行每一行对应一个表达式字符串，该字符串的长度不会超过1024。</p>','<p>输出n行，分别对应输入的n个表达式的值。</p>\r\n<p></p>','3\r\n100*3\r\n10+4/2\r\n5*(1+2)','300\r\n12\r\n15','<p><a id=\"fck_paste_padding\">﻿</a>可以借助栈来实现。</p>\r\n<p></p>','SCUT','2013-12-06 20:05:07',1,32,0,0,0),(11014,'The height of tree','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 32px;\">给出树的先根顺序存储序列（参看书上P211的公式6.3），其中&ldquo;)&rdquo;表示子树的结束，求树的高度。例：先根顺序存储序列RAC)D)E))BF)))，对应树如下：</span></p>\r\n<p><img src=\"/upload/201305/test1.png\" width=\"232\" height=\"186\" alt=\"\" /></p>\r\n<p></p>','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">首先输入整数N，表示N种测试情况。接下来是每种测试情况的输入数据。</span></p>\r\n<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">每种测试情况有一行，即树的先根顺序存储序列。</span></p>\r\n<p></p>','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">每种测试情况对应一行输出，输出对应树的高度。</span></p>\r\n<p></p>','2\r\nRAC)D)E))BF)))\r\nXPC)Q)RV)M))))','3\r\n4','','SCUT','2013-12-06 20:05:07',1,32,0,0,0),(11015,'Level-order Traversal of BST','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 32px;\">给出一个整数序列，请按照顺序建立二叉查找树（BST），然后层次化输出，即先输出根结点，然后是根结点的左孩子、根结点的右孩子，一层一层，从左到右地输出。</span></p>\r\n<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 32px;\">例：输入顺序为37，24，42，32，7，40，2，42，120。对应的二叉查找树如下所示。</span></p>\r\n<p><img src=\"/upload/201305/test2(1).jpg\" width=\"518\" height=\"347\" alt=\"\" /></p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-size: 16px; text-align: justify;\">层次化输出为：37</span><span style=\"font-family: \'Times New Roman\'; font-size: 16px; text-align: justify;\">&nbsp;</span><span style=\"font-family: \'Times New Roman\'; font-size: 16px; text-align: justify;\">24 42 7 32 40 42 2 120</span></p>\r\n<p><img src=\"/upload/201305/test2.jpg\" width=\"0\" height=\"0\" alt=\"\" /></p>\r\n<p></p>','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">首先输入整数N，表示N种测试情况。接下来是每种测试情况的输入数据。</span></p>\r\n<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">每种测试情况有一行，即整数序列。</span></p>\r\n<p></p>','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">每种测试情况对应一行层次化输出序列。</span></p>\r\n<p></p>','2\r\n37,24,42,32,7,40,2,42,120\r\n120,42,7,2,32,42,24,37,40','37 24 42 7 32 40 42 2 120 \r\n120 42 7 42 2 32 24 37 40 ','<p>&nbsp;如果判题结果为Presentation Error，请注意每行输出结尾的空格</p>','SCUT','2013-12-06 20:05:07',1,32,0,0,0),(11016,'Relation','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 32px;\">对于任意的两个人，希望知道他们是否具有亲戚关系（即，他们属于同一个大家族）。你可以获得一些亲戚关系的信息，比如知道Peter和Paul是亲戚，Paul和Bush是亲戚，那么，能推断出Peter和Bush也是亲戚。</span></p>\r\n<p></p>','<p><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">首先输入整数N</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">和M。 N</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">表示</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">有</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt;\">N</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">个人（1</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">&le;</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt;\">N</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">&le;3000）,人的编号为1，2，</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt;\">&hellip;</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">，</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt;\">N</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">。</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt;\">M</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">表示</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">接下来</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">有M行（1</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">&le;</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt;\">M</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">&le;3000），每行有两个数s和t，表明s和t是亲戚关系。</span></p>\r\n<p><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">然后输入整数P，表明下面有P行的询问（1</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">&le;</span><span style=\"font-family: \'Times New Roman\'; text-align: justify; text-indent: 24px; font-size: 12pt;\">P</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">&le;20000），每行有两个数y和z，询问y和z是否为亲戚。对于每次询问，若y和z是亲戚，输出YES，否则输出NO。</span></p>\r\n<p></p>','<p><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">每</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">次询问</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">对应一行</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">输出</span><span style=\"text-align: justify; text-indent: 24px; font-size: 12pt; font-family: 宋体;\">。</span></p>\r\n<p></p>','10 7\r\n2 4\r\n5 7\r\n1 3\r\n8 9\r\n1 2\r\n5 6\r\n2 3\r\n3\r\n3 4\r\n7 10\r\n8 9','YES\r\nNO\r\nYES','','SCUT','2013-12-06 20:05:07',1,32,0,0,0),(11017,'Find Median','<p><span style=\"font-size: medium;\">一个长度为L（L&ge;1）的升序序列S，处在第&lceil;L/2&rceil;个位置的数称为S的中位数。例如，若序列S1＝（11，13，15，17，19），则S1的中位数是15。两个序列的中位数是含它们所有元素的升序序列的中位数。例如，若S2＝（2，4，6，8，20），则S1和S2的中位数是11。现有两个等长升序序列A和B，找出A和B的中位数。</span></p>\r\n<p></p>','<div><span style=\"font-size: medium;\">第一行：升序序列A（都是正整数）；</span></div>\r\n<div><span style=\"font-size: medium;\">第二行：升序序列B（都是正整数）；</span></div>','<p><span style=\"font-size: medium;\"><span style=\"font-family: 宋体; line-height: 24px; text-align: justify; text-indent: 32px;\">输出A和B的中位数</span></span></p>\r\n<p></p>','11 13 15 17 19\r\n2 4 6 8 20','11','','SCUT','2013-12-06 20:05:07',1,4,0,0,0),(11018,'Hash','<p><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt; font-family: 宋体;\">使用闭散列，利用线性探查方法解决冲突，把</span><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt; font-family: 宋体;\">给出</span><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt; font-family: 宋体;\">的关键码插入到有</span><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt;\">n</span><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt; font-family: 宋体;\">个槽的散列表中（槽从0到</span><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt;\">n-1</span><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt; font-family: 宋体;\">编号）。使用的散列函数H(k) = k mod&nbsp;</span><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt;\">n。</span></p>\r\n<p></p>','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">第一行输入n（散列表的长度）；第二行输入关键码序列（都是正整数）。</span></p>\r\n<p></p>','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">按行输出散列表的情况，每一行两个整数，中间有一个空格隔开。</span></p>\r\n<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">第一个整数为槽号，第二个整数为对应槽所填的关键码。</span></p>\r\n<p></p>','13\r\n12 23 45 57 20 3 78 31 15 36','0 78\r\n2 15\r\n3 3\r\n5 57\r\n6 45\r\n7 20\r\n8 31\r\n10 23\r\n11 36\r\n12 12','','SCUT','2013-12-06 20:05:07',1,2,0,0,0),(11019,'MaxRepeatNum','<p><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt; font-family: 宋体;\">给出</span><span style=\"text-align: justify; text-indent: 32px; font-size: 12pt; font-family: 宋体;\">一个整数序列，求：其中重复出现次数最多的整数，以及其出现的次数。</span></p>\r\n<p></p>','<p><span style=\"font-family: 宋体; font-size: 16px; text-align: justify; text-indent: 24px;\">一个整数序列</span></p>\r\n<p></p>','<div><span style=\"font-size: medium;\">两个整数，中间有一个空格隔开。</span></div>\r\n<div><span style=\"font-size: medium;\">第一个整数：重复出现次数最多的整数；</span></div>\r\n<div><span style=\"font-size: medium;\">第二个整数：第一个整数的出现次数。</span></div>\r\n<p></p>','2 3 4 8 5 3 6 9 1 2 6 3 7 3','3 4','<p>&nbsp;<span style=\"text-align: justify; font-size: 12pt; font-family: 宋体;\">如果重复出现次数最多的整数有并列</span><span style=\"text-align: justify; font-size: 12pt; font-family: 宋体;\">几个</span><span style=\"text-align: justify; font-size: 12pt; font-family: 宋体;\">，那么请输出其中值最小的整数。</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-size: 16px; text-align: justify;\">注意算法的时间效率和空间效率。</span></p>','SCUT','2013-12-06 20:05:07',1,4,0,0,0),(11020,'The Max In-degree','<p class=\"cjk\" align=\"LEFT\" style=\"text-indent: 0.85cm; margin-bottom: 0cm; widows: 2; orphans: 2\"><font size=\"3\">给出一个有向图，包含</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">N (1 <font face=\"宋体, SimSun\">&le;</font> N<font face=\"宋体, SimSun\">&le;</font> 2,500) </span></font></font><font size=\"3\">个顶点，编号为</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">1</span></font></font><font size=\"3\">到<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">N</span></font></font><font size=\"3\">；图中包含</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C (1 <font face=\"宋体, SimSun\">&le;</font> C <font face=\"宋体, SimSun\">&le;</font> 6,200) </span></font></font><font size=\"3\">条弧。</font></p>\r\n<p align=\"LEFT\" style=\"text-indent: 0.85cm; margin-bottom: 0cm; widows: 2; orphans: 2\"><font size=\"3\">求：图中所有顶点中具有最大入度数的顶点编号及其入度数。如果出现最大入度数相同的多个顶点，则输出其中最小的顶点编号。</font></p>\r\n<p></p>','<p class=\"cjk\" style=\"text-indent: 0.64cm; margin-bottom: 0cm\"><font size=\"3\">首先输入整数</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">m</span></font></font><font size=\"3\">，表示</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">m</span></font></font><font size=\"3\">种测试情况。接下来是每种测试情况的输入数据。</font></p>\r\n<p class=\"cjk\" style=\"text-indent: 0.64cm; margin-bottom: 0cm\"><font size=\"3\">每种测试情况包含几行：</font></p>\r\n<p class=\"cjk\" style=\"text-indent: 1.06cm; margin-bottom: 0cm\"><font size=\"3\">第一行包括两个整数</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">N</span></font></font><font size=\"3\">和</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C</span></font></font><font size=\"3\">，含义如上所述。</font></p>\r\n<p class=\"cjk\" style=\"text-indent: 1.06cm; margin-bottom: 0cm\"><font size=\"3\">第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">2</span></font></font><font size=\"3\">到</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C+1</span></font></font><font size=\"3\">行中，第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">i+1</span></font></font><font size=\"3\">行依次输入两个整数</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">u</span></font></font><font size=\"3\">和</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">v</span></font></font><font size=\"3\">。</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">u</span></font></font><font size=\"3\">表示第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">i</span></font></font><font size=\"3\">条弧的起点编号，</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">v</span></font></font><font size=\"3\">表示第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">i</span></font></font><font size=\"3\">条弧的终点编号。</font></p>\r\n<p></p>','<p class=\"cjk\" style=\"text-indent: 0.85cm; margin-bottom: 0cm\"><font size=\"3\">对于每种情况输出一行，每行两个整数，第一个整数表示图中具有最大入度数的顶点编号，第二个整数表示该顶点的入度数。</font></p>\r\n<p></p>','1\r\n7 11\r\n2 4\r\n1 4\r\n7 2\r\n3 4\r\n5 7\r\n7 3\r\n6 1\r\n6 3\r\n2 4\r\n5 6\r\n7 2','4 4','<p align=\"LEFT\" style=\"margin-bottom: 0cm; widows: 2; orphans: 2\"><font size=\"3\">图中两顶点之间允许多重边，如果有顶点</font><font face=\"宋体, SimSun\"><font size=\"3\"><span lang=\"en-US\">v</span></font></font><font size=\"3\">到自身的环，则</font><font face=\"宋体, SimSun\"><font size=\"3\"><span lang=\"en-US\">v</span></font></font><font size=\"3\">的入度增加</font><font face=\"宋体, SimSun\"><font size=\"3\"><span lang=\"en-US\">1.</span></font></font></p>\r\n<p></p>','SCUT','2013-12-06 20:05:07',1,10,0,0,0),(11021,'The Shortest Path','<p class=\"cjk\" style=\"margin-bottom: 0cm\"><font size=\"3\">某一个国家有<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">T (1 <font face=\"宋体, SimSun\">&le;</font> T <font face=\"宋体, SimSun\">&le;</font> 2,500) </span></font></font><font size=\"3\">个城市，编号分别是从</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">1 </span></font></font><font size=\"3\">到<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">T</span></font></font><font size=\"3\">。除了起点和终点以外的每个城市，<font face=\"Times New Roman, serif\"> </font>都至少连接另外的两个城市（通过无向的道路连接）。</font></p>\r\n<p class=\"cjk\" style=\"margin-bottom: 0cm\"><font size=\"3\">给一幅地图，其中有</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C (1 <font face=\"宋体, SimSun\">&le;</font> C <font face=\"宋体, SimSun\">&le;</font> 6,200) </span></font></font><font size=\"3\">条道路，道路的两端分别为<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">R<sub>1i</sub> </span></font></font><font size=\"3\">和<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">R<sub>2i</sub> (1 <font face=\"宋体, SimSun\">&le;</font>R<sub>1i</sub> <font face=\"宋体, SimSun\">&le;</font> T</span></font></font><font size=\"3\">；<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">1 <font face=\"宋体, SimSun\">&le;</font> R<sub>2i</sub> <font face=\"宋体, SimSun\">&le;</font> T) </span></font></font><font size=\"3\">，</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">R<sub>1i</sub> </span></font></font><font size=\"3\">和<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">R<sub>2i</sub></span></font></font><font size=\"3\">之间的道路长度为<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C<sub>i</sub> (1 <font face=\"宋体, SimSun\">&le;</font> C<sub>i</sub> <font face=\"宋体, SimSun\">&le;</font>1,000)</span></font></font><font size=\"3\">。请寻找由起点城市</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">Ts (1 <font face=\"宋体, SimSun\">&le;</font> Ts <font face=\"宋体, SimSun\">&le;</font> T)</span></font></font><font size=\"3\">到终点城市</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">Te (1 <font face=\"宋体, SimSun\">&le;</font> Te <font face=\"宋体, SimSun\">&le;</font> T)</span></font></font><font size=\"3\">的最近路径。</font></p>\r\n<p></p>','<p class=\"cjk\" style=\"text-indent: 0.64cm; margin-bottom: 0cm\"><font size=\"3\">首先输入整数</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">m</span></font></font><font size=\"3\">，表示</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">m</span></font></font><font size=\"3\">种测试情况。接下来是每种测试情况的输入数据。</font></p>\r\n<p class=\"cjk\" style=\"text-indent: 0.64cm; margin-bottom: 0cm\"><font size=\"3\">每种测试情况包含几行：</font></p>\r\n<p class=\"cjk\" style=\"text-indent: 1.06cm; margin-bottom: 0cm\"><font size=\"3\">第一行包括</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">4</span></font></font><font size=\"3\">个整数</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">T</span></font></font><font size=\"3\">、</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C</span></font></font><font size=\"3\">、</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">Ts</span></font></font><font size=\"3\">、</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">Te</span></font></font><font size=\"3\">，含义如上所述。</font></p>\r\n<p class=\"cjk\" style=\"text-indent: 1.06cm; margin-bottom: 0cm\"><font size=\"3\">第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">2</span></font></font><font size=\"3\">到</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C+1</span></font></font><font size=\"3\">行中，第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">i+1</span></font></font><font size=\"3\">行输入</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">3</span></font></font><font size=\"3\">个整数，分别表示第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">i</span></font></font><font size=\"3\">条边的</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">R<sub>1i </sub></span></font></font><font size=\"3\">和<font face=\"Times New Roman, serif\"> </font></font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">R<sub>2i</sub></span></font></font><font size=\"3\">和</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C<sub>i</sub></span></font></font><font size=\"3\">。</font></p>\r\n<p></p>','<p class=\"cjk\" style=\"text-indent: 0.85cm; margin-bottom: 0cm\"><font size=\"3\">对于每种情况输出一行，每行一个整数序列，表示该种情况的图中</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">Ts</span></font></font><font size=\"3\">到</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">Te</span></font></font><font size=\"3\">的最短路径。（保证每种情况一定能找到这样的路径）。</font></p>\r\n<p></p>','1\r\n7 11 5 4\r\n2 4 2\r\n1 4 3\r\n7 2 2\r\n3 4 3\r\n5 7 5\r\n7 3 3\r\n6 1 1\r\n6 3 4\r\n2 4 3\r\n5 6 3\r\n7 2 1','5 6 1 4','<p align=\"LEFT\" style=\"margin-bottom: 0cm; widows: 2; orphans: 2\"><font size=\"3\">输入中可能存在重边的情况。</font></p>\r\n<p></p>','SCUT','2013-12-06 20:05:07',1,32,0,0,0),(11022,'Toposort','<p class=\"cjk\" style=\"text-indent: 0.64cm; margin-bottom: 0cm\"><span style=\"font-size: medium; text-indent: 0.85cm;\">给出一个有向图，判断图中是否存在回路。</span></p>\r\n<p></p>','<p class=\"cjk\" style=\"text-indent: 0.64cm; margin-bottom: 0cm\"><font size=\"3\">第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">1</span></font></font><font size=\"3\">行：输入图的顶点个数</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">N</span></font></font><font size=\"3\">（</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">1 <font face=\"宋体, SimSun\">&le;</font> N<font face=\"宋体, SimSun\">&le;</font> 2,500</span></font></font><font size=\"3\">）和</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C</span></font></font><font size=\"3\">（图的边数，</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">1 <font face=\"宋体, SimSun\">&le;</font> C <font face=\"宋体, SimSun\">&le;</font> 6,200</span></font></font><font size=\"3\">）；</font></p>\r\n<p class=\"cjk\" style=\"text-indent: 0.64cm; margin-bottom: 0cm\"><font size=\"3\">第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">2</span></font></font><font size=\"3\">到</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">C+1</span></font></font><font size=\"3\">行中，第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">i+1</span></font></font><font size=\"3\">行输入两个整数，分别表示第</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">i</span></font></font><font size=\"3\">条边的起点和终点的编号。</font></p>','<p class=\"cjk\" style=\"text-indent: 0.64cm; margin-bottom: 0cm\"><font size=\"3\">如果图中存在回路，输出&ldquo;</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">YES<font face=\"宋体, SimSun\">&rdquo;</font></span></font></font><font size=\"3\">，否则，输出&ldquo;</font><font face=\"Times New Roman, serif\"><font size=\"3\"><span lang=\"en-US\">NO<font face=\"宋体, SimSun\">&rdquo;</font></span></font></font><font size=\"3\">。</font></p>\r\n<p></p>','7 8\r\n1 2\r\n1 3\r\n2 4\r\n2 6\r\n3 4\r\n4 5\r\n5 2\r\n5 7','YES','','SCUT','2013-12-06 20:05:07',1,32,0,0,0);
